import TypeWriterEffect from 'react-typewriter-effect';

const image = require("../images/Food.png")

function Home() {

    return(
      <div className="home"> 
          <img src={image} className="image" alt="img"></img>
        <div className="homeBox">
              <div class="circle"></div>
              <div className='homeBottomBox'>
                  <h1 className='homeType'>

                    <TypeWriterEffect

                      textStyle={{ 
                      fontFamily: 'Red Hat Display',
                      color: 'whitesmoke',
                      fontWeight: 200,
                      fontSize: '1.5em',
                      showCursor: false,
                      stop
                    }}
                      startDelay={100}

                      text="Welcome to Give Good"
                      typeSpeed={50}

                    />
                    <TypeWriterEffect

                    textStyle={{ 
                    fontFamily: 'Red Hat Display',
                    color: 'whitesmoke',
                    fontWeight: 200,
                    fontSize: '1.5em'
                    }}
                    startDelay={1200}
                    text="Give"
                    typeSpeed={50}

                    />
                    <TypeWriterEffect

                    textStyle={{ 
                    fontFamily: 'Red Hat Display',
                    color: 'whitesmoke',
                    fontWeight: 200,
                    fontSize: '1.5em'
                    }}
                    startDelay={2000}
                    text="Receive"
                    typeSpeed={50}

                    />
                    <TypeWriterEffect

                    textStyle={{ 
                    fontFamily: 'Red Hat Display',
                    color: 'whitesmoke',
                    fontWeight: 200,
                    fontSize: '1.5em'
                    }}
                    startDelay={2800}
                    text="Save food"
                    typeSpeed={50}

                    />

                  </h1>
             </div>

        </div>
      </div>
  );

}

export default Home;
